import React from "react";

class Table extends React.Component {
  render() {
    return (
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Total</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>Food</td>
            <td>50</td>
          </tr>
          <tr>
            <td>House</td>
            <td>150</td>
          </tr>
          <tr>
            <td>Car</td>
            <td>70</td>
          </tr>
        </tbody>
      </table>
    );
  }
}

export default Table;
